import React from 'react';
import './App.css';
import { Grid } from '@material-ui/core';
import { Form } from './components/Form/Form';

function App() {
  return (
    <div className="App">
      <header>
        <h1>Rodri's Todo List</h1>
      </header>
      <Grid container spacing={3}>
        <Form />
      </Grid>
    </div>
  );
}

export default App;
